const e=JSON.parse('{"key":"v-4d2ab879","path":"/posts/%E5%AD%A6%E4%B9%A0%E5%B0%8F%E8%AE%B0/git%E6%92%A4%E9%94%80%E6%96%87%E4%BB%B6.html","title":"git撤销提交的文件","lang":"zh-CN","frontmatter":{"title":"git撤销提交的文件","category":["学习小记"],"tag":["Git"],"contributors":false,"editLink":false,"comment":false,"description":"Git撤销提交的文件 在提交代码到仓库后, 发现把一个不需要的文件也提交了，所以需要将这个文件从仓库中删除, 然后修改 .gitingore文件，在使用 git add等命令时排除文件 具体的做法如下： 修改 .gitignore 文件排除某些文件后，如果文件已经被提交到了 Git 仓库中，可以执行以下步骤来确保这些文件从 Git 仓库中被移除： 从 Git 仓库中移除文件： 从 Git 仓库中移除不应该被跟踪的文件。 git rm --cached path/to/ignored_file 这个命令会将指定的文件从 Git 仓库中移除，但会保留在工作目录中。 提交更改： 提交这些更改到 Git 仓库： git commit -m \\"Remove ignored files\\" 推送更改到远程仓库： 将这些更改推送到远程仓库： git push origin your-branch","head":[["meta",{"property":"og:url","content":"https://mister-hope.github.io/blog/posts/%E5%AD%A6%E4%B9%A0%E5%B0%8F%E8%AE%B0/git%E6%92%A4%E9%94%80%E6%96%87%E4%BB%B6.html"}],["meta",{"property":"og:site_name","content":"Lee"}],["meta",{"property":"og:title","content":"git撤销提交的文件"}],["meta",{"property":"og:description","content":"Git撤销提交的文件 在提交代码到仓库后, 发现把一个不需要的文件也提交了，所以需要将这个文件从仓库中删除, 然后修改 .gitingore文件，在使用 git add等命令时排除文件 具体的做法如下： 修改 .gitignore 文件排除某些文件后，如果文件已经被提交到了 Git 仓库中，可以执行以下步骤来确保这些文件从 Git 仓库中被移除： 从 Git 仓库中移除文件： 从 Git 仓库中移除不应该被跟踪的文件。 git rm --cached path/to/ignored_file 这个命令会将指定的文件从 Git 仓库中移除，但会保留在工作目录中。 提交更改： 提交这些更改到 Git 仓库： git commit -m \\"Remove ignored files\\" 推送更改到远程仓库： 将这些更改推送到远程仓库： git push origin your-branch"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2024-02-22T16:03:20.000Z"}],["meta",{"property":"article:author","content":"Lee"}],["meta",{"property":"article:tag","content":"Git"}],["meta",{"property":"article:modified_time","content":"2024-02-22T16:03:20.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"git撤销提交的文件\\",\\"image\\":[\\"\\"],\\"dateModified\\":\\"2024-02-22T16:03:20.000Z\\",\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"Lee\\",\\"url\\":\\"https://mister-hope.com\\"}]}"]]},"headers":[],"git":{"createdTime":1708617800000,"updatedTime":1708617800000,"contributors":[{"name":"righthan","email":"2753875841@qq.com","commits":1}]},"readingTime":{"minutes":0.85,"words":255},"filePathRelative":"posts/学习小记/git撤销文件.md","localizedDate":"2024年2月22日","excerpt":"<h1> Git撤销提交的文件</h1>\\n<p>在提交代码到仓库后, 发现把一个不需要的文件也提交了，所以需要将这个文件从仓库中删除, 然后修改 <code>.gitingore</code>文件，在使用 <code>git add</code>等命令时排除文件</p>\\n<p>具体的做法如下：</p>\\n<p>修改 <code>.gitignore</code> 文件排除某些文件后，如果文件已经被提交到了 Git 仓库中，可以执行以下步骤来确保这些文件从 Git 仓库中被移除：</p>\\n<ol>\\n<li>\\n<p><strong>从 Git 仓库中移除文件：</strong> 从 Git 仓库中移除不应该被跟踪的文件。</p>\\n<div class=\\"language-bash line-numbers-mode\\" data-ext=\\"sh\\"><pre class=\\"language-bash\\"><code><span class=\\"token function\\">git</span> <span class=\\"token function\\">rm</span> <span class=\\"token parameter variable\\">--cached</span> path/to/ignored_file\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div></div></div><p>这个命令会将指定的文件从 Git 仓库中移除，但会保留在工作目录中。</p>\\n</li>\\n<li>\\n<p><strong>提交更改：</strong> 提交这些更改到 Git 仓库：</p>\\n<div class=\\"language-bash line-numbers-mode\\" data-ext=\\"sh\\"><pre class=\\"language-bash\\"><code><span class=\\"token function\\">git</span> commit <span class=\\"token parameter variable\\">-m</span> <span class=\\"token string\\">\\"Remove ignored files\\"</span>\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div></div></div></li>\\n<li>\\n<p><strong>推送更改到远程仓库：</strong> 将这些更改推送到远程仓库：</p>\\n<div class=\\"language-bash line-numbers-mode\\" data-ext=\\"sh\\"><pre class=\\"language-bash\\"><code><span class=\\"token function\\">git</span> push origin your-branch\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div></div></div></li>\\n</ol>","autoDesc":true}');export{e as data};
